m ở da, Vitamin C cũng là một chất dinh dưỡng chống oxy hóa rất quan trọng.                                                                                                                                                                                                                           Chiết Xuất Trà Đen                             Giúp dưỡng ẩm, làm chậm tiến trình oxy hóa, đồng thời giúp làm mờ và giảm sự hình thành nếp nhăn và dấu chân chim trên da.                                                                                                            Thành phần chính:  Chiết xuất từ trái Camu Camu: loại “thần dược” có đến 60 lần lượng Vitamin C chứa trong quả cam, có khả năng chống oxy hóa mạnh mẽ, kích thích sản sinh Collagen, mang lại làn da săn chắc và tươi trẻ hơn, xóa mờ các nếp nhăn li ti, làm sáng và đều màu da. Chiết xuất trà đen Kombucha: thành phần kết hợp giữa AHA, Vitamin & Polyphenos có khả năng chống oxy hóa gấp 100 lần so với Vitamin C, vừa giúp ngăn ngừa các dấu hiện lão hóa da, vừa cải thiện kết cấu làn da. Vitamin E: chống oxy hóa, dưỡng da ẩm mượt mịn màng. Nước khoáng Vichy: với 15 loại khoáng chất giúp tăng cường sức khỏe cho làn da chống lại những tác nhân gây hại từ môi trường, cấp ẩm và làm dịu mát da tức thì.  Thành phần đầy đủ: Aqua/Water, Homosalate, Silica, Ethylhexyl Salicylate, Ethylhexyl Triazone, Glycerin, C12-15 Alkyl Benzoate, Bis-Ethylhexyloxyphenol Methoxyphenyl Triazine, Drometrizole Trisiloxane, Butyl Methoxydibenzoylmethane, Saccharomyces/ Xylinum/ Black Tea Ferment, Aluminym Starch Octenylsuccinate, Octocrylene, Pentylene Glycol, Styrene/ Acrylates Copolymer, Potassium Cetyl Phosphate, Parfum /Fragrance, Caprylyl Methicone, Terephthalylidene Dicamphor Sulfonic Acid, Butylene Glycol, Titanium Dioxide [Nano] / Titanium Dioxide, Triethanolamine, Phenoxyethanol, Caprylyl Glycol, Stearyl Alcohol, Dimethicone, Acrylates/ C10-30 Alkyl Acrylate Crosspolymer, Inulin Lauryl Carbamate, Peg-8 Laurate, Disodium Edta, Tocopher