hục hồi da mụn nhanh chóng. Đồng thời, kích thích sản sinh collagen xoa dịu tổn thương và hỗ trợ làm mờ thâm nám.   Vitis Vinifera (Grape) Fruit Extract (Chiết xuất nho): nổi trội trong việc nâng tông da, dưỡng trắng và chống oxy hóa, ngăn lão hóa da.   Hydrogenated Phosphatidylcholine: hạn chế tối đa nguy cơ kích ứng, mẩn đỏ cho da nhạy cảm.   Caprylic/Capric Triglyceride (chiết xuất từ gốc tự nhiên, tinh dầu dừa): có tác dụng giảm độ nhờn rít, bảo vệ da khỏi tác nhân gây hại của UV.   2. Kem Dưỡng Cấp Ẩm Caryophy Skin Repair Cream 10ml Thành phần chính:    Thành phần Guaiazulene được chiết xuất từ hoa cúc tạo màu xanh dịu mát tự nhiên, giúp làm dịu da kích ứng, nhạy cảm vô cùng hiệu quả.    Thành phần Cica củng cố hàng rào bảo vệ, cấp ẩm, làm dịu da và hỗ trợ phục hồi da mụn.   Chiết xuất cây phỉ thúc đẩy quá trình tuần hoàn tái tạo da, giúp cải thiện và tái tạo làn da mới.    Thành phần chi tiết:  Water, Glycerin, Caprylic/Capric Triglyceride, Butylene Glycol, Cyclopentasiloxane, Polyglyceryl-4 Laurate, Polyglyceryl-6 Laurate, Centella asiatica Extract, Portulaca Oleracea Extract, Vitis Vinifera (Grape) Fruit Extract, Hamamelis Virginiana (Witch Hazel) Bark/Leaf/Twig Extract, Guai azulene, Panthenol, Propanediol, Sodium Acrylate/Sodium Acryloyldimethyl Taurate Copolymer, Am monium Acryloyldimethyltaurate/VP Copolymer, Isohexadecane, Polysorbate 80, Hydroxyacetophe none, 1,2-Hexanediol, Disodium EDTA.      ',353,21,222,'https://media.hcdn.vn/catalog/product/p/r/promotions-auto-essence-chong-nang-biore-mang-nuoc-duong-am-da-85g_gy9hxFaG3YBFMvJ8_img_380x380_64adc6_fit_center.png',8,68),(4127,'[Mini] Gel Chống Nắng Anessa Dưỡng Sáng Nâng Tông 15g ','     Thành phần sản phẩm              Thành phần chính:   Phức hợp hoạt chất [5% Niacinamide + Probiotic Fraction + Peptide] giúp cải thiện và ngăn ngừa lão hóa, thâm, nám đốm nâu.   Thành phần chi tiết: Aqua/Water/Eau, Alcohol Denat, Diisopropyl Sebacate, Silica, Isopropyl Myristate, Ethylhexyl Salicylate, Ethylhexyl Tri