amine, Myristic Acid, Aluminum Hydroxide, Phenoxyethanol, Limonene, Ascorbyl Glucoside, Disodium Stearoyl Glutamate, Tocopheryl Acetate, Tocopherol, Dipropylene Glycol, Caprylyl Glycol, Capryloyl Salicylic Acid, Laureth-7, Tetrasodium Edta, Citrus Limon Fruit Extract / Lemon Fruit Extract, Citral, Citrus Junos Fruit Extract, Maltodextrin, Cetyl Alcohol, Polyacrylamide, Benzyl Salicylate, Bbenzyl Alcohol     ',1000,18,95,'https://media.hcdn.vn/catalog/product/g/o/google-shopping-mini-gel-chong-nang-anessa-duong-am-bao-ve-hoan-hao-15g-1697005336_img_380x380_64adc6_fit_center.jpg',8,68),(4140,'Sữa Chống Nắng Thể Thao Banana Boat Sport SPF 50 90ml ','     Thành phần sản phẩm              1. Kem Chống Nắng Cocoon Bí Đao Quang Phổ Rộng 50ml Thành phần chính:    Chiết xuất bí đao: có tác dụng giảm viêm, kháng khuẩn, làm dịu, giúp giảm mụn viêm.   Vitamin B3 (Niacinamide): tăng cường hàng rào bảo vệ da ngăn lại các tác động xấu từ môi trường như ô nhiễm, khói bụi, góp phần tổng hợp ceramide của lớp sừng và hyaluronic acid tự nhiên.   Vitamin E (Tocopherol): là một chất chống oxi hoá mạnh được chiết xuất hoàn toàn từ đậu nành không biến đổi gen (Non-GMO).   Hydroxymethoxyphenyl Decanone: là một chất chống oxi hoá bảo vệ tế bào, giảm tình trạng kích ứng, bảo vệ da khỏi những tổn thương.    Tetrahexyldecyl Ascorbate: là một dẫn xuất vitamin C chống oxi hoá mạnh, bảo vệ tế bào trước bức xạ UV và ngăn ngừa sự hình thành sắc tố do UV gây ra.   Tinosorb A2B (Tris-Biphenyl Triazine): là màng lọc thế hệ mới bảo vệ hiệu quả nhất trong quãng UVB/UVA2 với đỉnh hấp thụ là 310nm, đồng thời giúp tăng cường cho quãng UVA1.   Tinosorb S (Bis-Ethylhexyloxyphenol Methoxyphenyl Triazine): màng lọc phổ rộng thế hệ mới với phổ bảo vệ rất dài bao phủ từ UVB, UVA2 cho đến UVA1 với 2 đỉnh chống UV 310nm và 345nm.    Uvinul T150 (Ethylhexyl Triazone): màng lọc thế hệ mới mang lại khả năng hấp thụ ổn định UVB cao nhất trong số tất cả các bộ lọc UVB trên thị trường hiện nay.   Uvinul A Plus (Diethylamino Hydroxybenzoyl Hexyl Benzoate): là màng lọc thế hệ mới chống UVA2/UVA1 rất mạnh với đỉnh bảo vệ lên đến 354nm, cùng khả năng bảo vệ tuyệt vời ngăn lại các gốc tự do.   Parsol 1789 (Avobenzone - Butyl Methoxydibenzoylmethane): được xem là màng lọc chống UVA mạnh nhất hiện nay và cũng là màng lọc duy nhất được thông qua trên toàn cầu với quãng hấp thụ rộng và đỉnh hấp thụ rất cao 357 nm.   Thành phần đầy đủ:  Aqua/Water, C12-15 Alkyl Benzoate, Isododecane, Cyclopentasiloxane, Bis Ethylhexyloxyphenol Methoxyphenyl Triazine, Butyloctyl Salicylate, TrisBiphenyl Triazine, Silica, Methyl Methacrylate Crosspolymer, Dicaprylyl Carbonate, Ethylhexyl Triazone, Butyl Methoxydibenzoylmethane, Diethylamino Hydroxybenzoyl Hexyl Benzoate, Ethylhexyl Methoxycrylene, Caprylyl Methicone, Benincasa Cerifera Fruit Extract, Niacinamide, Betaine, Hydroxymethoxyphenyl Decanone, Tetrahexyldecyl Ascorbate, Glycine Soja (Soybean) Seed Extract, Acrylates/C10-30 Alkyl Acrylate Crosspolymer, Trimethylsiloxysilicate, Glycerin, Propanediol, Butylene Glycol, Pentylene Glycol, 1,2-Hexanediol, Trisodium Ethylenediamine Disuccinate, Tocopherol, Decyl Glucoside, Ethylhexylglycerin, Caprylic/Capric Triglyceride, Disodium Phosphate, Xanthan Gum, Phenoxyethanol. 2. Tinh Chất Bí Đao Cocoon Làm Giảm Mụn, Mờ Thâm 70ml Thành phần chính:   Bí đao: Có đặc tính làm mát, làm giảm nhiệt, kháng viêm và diệt khuẩn giúp điều trị mụn trứng cá, mụn viêm.   Rau má: Tăng sinh collagen cho làn da, kháng viêm, làm dịu các vết đỏ và giảm kích ứng.   Tinh dầu tràm trà: Loại tinh dầu có mùi thơm ấm áp, cay nồng giúp giảm mụn trứng cá, vết thương, côn trùng cắn.   Vitamin B3 (Niacinamide): Giúp hỗ trợ giảm mụn hiệu quả, kiểm soát lượng dầu thừa và làm giảm sự xuất hiện của lỗ chân lông to.   Thành phần đầy đủ: Aqua/Water, Niacinamide, Salicylic Acid, Cocamidopropyl Dimethylamine, Benincasa Cerifera Fruit Extract, Centella Asiatica Extract, Butylene Glycol, Pentylene Glycol, Bisabolol, Zinc PCA, Phellodendron Amurense Bark